        {
            if ((endpointConfiguration == EndpointConfiguration.LDBSVServiceSoap))
            {
                return new System.ServiceModel.EndpointAddress("https://lite.realtime.nationalrail.co.uk/OpenLDBSVWS/ldbsv12.asmx");
            }
            if ((endpointConfiguration == EndpointConfiguration.LDBSVServiceSoap12))
            {
                return new System.ServiceModel.EndpointAddress("https://lite.realtime.nationalrail.co.uk/OpenLDBSVWS/ldbsv12.asmx");
            }
            throw new System.InvalidOperationException(string.Format("Could not find endpoint with name \'{0}\'.", endpointConfiguration));
        }

        public enum EndpointConfiguration
        {

            LDBSVServiceSoap,

            LDBSVServiceSoap12,
        }
    }
